description:
The Hoot Multisound Emulator is a application that emulates the music from old computer systems such as the PC98 and CM-64.

This includes the Hoot build from 2014/06/08 and the complete Hoot Archives download from http://snesmusic.org/hoot/v2/ . Also contains a getting started readme for help, since the application is in Japanese.

